import ImageSlider from "./ImageSlider";
import './Gallery.css';

const Gallery = () => {
  const slides = [
    { url: "instaPic/1.jpg", title: "beach" },
    { url: "instaPic/2.jpg", title: "boat" },
    { url: "instaPic/3.jpg", title: "forest" },
    { url: "instaPic/4.jpg", title: "city" },
    { url: "instaPic/5.jpg", title: "italy" },
  ];
  const containerStyles = {
    width: "600px",
    height: "440px",
    margin: "0 auto",
  };
  const containerStyles1 = {
    width: "600px",
    height: "440px",
    margin: "0 auto",
  };
  const containerStyles2 = {
    width: "600px",
    height: "440px",
    margin: "0 auto",
  };


  return (
    <div>
      <div className="gallery02" style={containerStyles}>
        <ImageSlider slides={slides} />
      </div>
      <div className="gallery01" style={containerStyles1}>
        <ImageSlider slides={slides} />
      </div>


      <div className="gallery02" style={containerStyles2}>
        <ImageSlider slides={slides} />
      </div>
      </div> 
  );
};

export default Gallery;
